import React from 'react';
import {Switch, Route} from "react-router";
import { GameCard } from "../menu/games/index";
import Home from '../menu/home/Home';
import { PlayerList } from '../menu';

export default () => (
    <Switch>
        <Route exact path="/">
            <Home />
        </Route>
        <Route path="/games">
            <GameCard />
        </Route>
        <Route path="/players">
            <PlayerList />
        </Route>
    </Switch>
)
